function Product(){
    const price=310;
    return (
        <div>
            <div>
            <img className='card-image' src={bottles} alt="bottles"/>
            </div>
            <div>
                <h3>Bottle</h3>
                <p>Bottle Description</p>
                <p>Price : <span>{`$ ${price}`}</span></p>
                <p>In Stock</p>
                <button>Add to Cart</button>
            </div>
        </div>
    )
}
export default Product;
